import React from "react";
import "./About.css";

const About = () => {
  return (
    <section className="wrapper">
      <h1>About</h1>
      <p>
      A self-motivated, creative, and ambitious IT professional with proficiency in React, PHP, JavaScript,HTML and CSS,
ability to communicate effectively in a team setting, and possessing
strong skills and ability in writing clean and efficient code, seeks to apply for the position Front End Developer.

You can view my code on GitHub.
      </p>
    </section>
  );
};

export default About;
